import "./index.css";
const SnackGame = () => {
  let blockMaping = require("../../json/maping.json");
  return (
    <div className="snake-game-container">
      {/* {
                blockMaping.map((value)=>{
                    return(
                        <div className= "div" id ={value.block} data-for-ladder = {value.ladder} data-for-snack = {value.snack}> {value.block}</div>
                    )
                })
            } */}
      {blockMaping.map((value, index) => {
        return (
          <>
            <div
              className={`row${index}`}
              id={value.block}
              data-for-ladder={value.ladder}
              data-for-snack={value.snack}
            >
              <div className={`block-${index}`}>{value.block}</div>
              <div class="oneRed"></div>
              <div class="oneGreen"></div>
            </div>
          </>
        );
      })}
    </div>
  );
};
export default SnackGame;
